import React from 'react'

const LoginJ = () => {
  return (
    <div>
      <input placeholder='Enter name'>Enter name</input>
    <input placeholder='Enter password'>Enter password</input>
    <input type='submit' onClick={()=>check()}></input>
    </div>
  )
}

export default LoginJ
